import React, { Component } from "react";

class Footer extends Component {
  render() {
    return (
      <footer>
        <ul>
          <li>이용약관</li>
          <li>개인정보처리방침</li>
          <li>커뮤니티이용규칙</li>
          <li></li>
        </ul>
      </footer>
    );
  }
}

export default Footer;
